import classes from "./AvailableMeals.module.css";
import MealItem from "./MealItem/MealItem";
import Card from "../UI/Card";

const DUMMY_MEALS = [
  {
    id: "m1",
    name: "Sake Don",
    description: "Spicy Salmon Sashimi on top of Rice",
    price: 22.99,
  },
  {
    id: "m2",
    name: "Miso Ramen",
    description: "Ramen for Vegetarian",
    price: 16.5,
  },
  {
    id: "m3",
    name: "Marinated BBQ Chicken Don",
    description: "where east meets west",
    price: 12.99,
  },
  {
    id: "m4",
    name: "Octupus Stir Fry",
    description: "Served on a hot plate with rice included",
    price: 18.99,
  },
];

const AvailableMeals = () => {
  const mealsList = DUMMY_MEALS.map((meal) => {
    return (
      <MealItem
        key={meal.id}
        id={meal.id}
        name={meal.name}
        description={meal.description}
        price={meal.price}
      />
    );
  });

  return (
    <section className={classes.meals}>
      <Card>
        <ul>{mealsList} </ul>
      </Card>
    </section>
  );
};

export default AvailableMeals;
